import "./App.css";
import banner from "./banner.png";
import squarespace from "./squarespace.svg"
import React, { useState, useEffect } from 'react';
import { Heading } from './components/Heading';
import { UnsplashImage } from './components/UnsplashImage';
import { Loader } from './components/Loader';
import axios from 'axios';
import InfiniteScroll from 'react-infinite-scroll-component';

import styled from 'styled-components';
import { createGlobalStyle } from 'styled-components';

function App() {
const [images, setImage] = useState([]);

  const [items, setitem] = React.useState([]);
  const [items1, setitem1] = React.useState([]);
  const [items2, setitem2] = React.useState([]);

  useEffect(() => {
    fetchImages();
  }, [])

  const fetchImages = (count = 10) => {
    const apiRoot = "https://api.unsplash.com";
    const accessKey = process.env.REACT_APP_ACCESSKEY;

    axios
      .get(`${apiRoot}/photos/random?client_id=d-LkQ147e_thL57BcZo3md05pDVFELieWfQ3GFKX6go&count=${count}`)
      .then(res => {
        setImage([...images, ...res.data]);
      })
  }
